/** @jsx jsx */
import { jsx } from "theme-ui";
import { Container, Grid } from "theme-ui";
import SectionHeader from "components/section-header";
import { FaFileExcel } from "react-icons/fa";
import { Carousel } from 'react-responsive-carousel';

const tooglesGroupId = 'Toggles';
const valuesGroupId = 'Values';
const mainGroupId = 'Main';

const getConfigurableProps = () => ({
    showArrows: boolean('showArrows', true, tooglesGroupId),
    showStatus: boolean('showStatus', true, tooglesGroupId),
    showIndicators: boolean('showIndicators', true, tooglesGroupId),
    infiniteLoop: boolean('infiniteLoop', true, tooglesGroupId),
    showThumbs: boolean('showThumbs', true, tooglesGroupId),
    useKeyboardArrows: boolean('useKeyboardArrows', true, tooglesGroupId),
    autoPlay: boolean('autoPlay', true, tooglesGroupId),
    stopOnHover: boolean('stopOnHover', true, tooglesGroupId),
    swipeable: boolean('swipeable', true, tooglesGroupId),
    dynamicHeight: boolean('dynamicHeight', true, tooglesGroupId),
    emulateTouch: boolean('emulateTouch', true, tooglesGroupId),
    autoFocus: boolean('autoFocus', false, tooglesGroupId),
    thumbWidth: number('thumbWidth', 100, {}, valuesGroupId),
    selectedItem: number('selectedItem', 0, {}, valuesGroupId),
    interval: number('interval', 2000, {}, valuesGroupId),
    transitionTime: number('transitionTime', 500, {}, valuesGroupId),
    swipeScrollTolerance: number('swipeScrollTolerance', 5, {}, valuesGroupId),
    ariaLabel: text('ariaLabel', undefined),
});

function Feature({data}) {
  const images = data.data;
  // console.log("props:\n", data);
  return (
    <section sx={{ variant: "section.feature" }} id="gallery">
      <Container>
        <SectionHeader
          slogan="Recent works"
          title="Here are some examples of our work!"
        />
        {/* <Grid sx={styles.grid}> */}
          <Carousel {...getConfigurableProps()}>
            <div>
              <img src="https://scontent.cdninstagram.com/v/t51.29350-15/288991226_4048529642039083_5872947077685539097_n.jpg?_nc_cat=105&ccb=1-7&_nc_sid=8ae9d6&_nc_ohc=VWZcKWvyqBwAX_SADoy&_nc_ht=scontent.cdninstagram.com&edm=ANo9K5cEAAAA&oh=00_AT9Q_z5Dao6z0YfDb2ozGwXZIqAIc2pKAHBz-FqSAYzaRg&oe=62B33826"/>
            </div>
          </Carousel>
              {/* </Grid> */}
        </Container>
    </section>
  );
}


const styles = {
  grid: {
    gridGap: [
      "0px",
    ],
    rowGap:[
      "0px"
    ],
    gridTemplateColumns: ["repeat(4, [col-start] fit-content(200px) [col-end])"],
  },
};

export default Feature;

